import './Header.css';
import {React, useContext, useEffect } from 'react';
//import Cookies from 'js-cookie';
//import { useNavigate } from 'react-router-dom';
import AuthContext from '../Context/AuthContext';
import axios from 'axios';
const Header = () => {
  //const navigate = useNavigate();
  const { logout, userAdmin } = useContext(AuthContext);
  
  useEffect(async ()  =>{
    try{
      const apiUrl = `${process.env.REACT_APP_API_URL}/api/auth/user`;
      const response = await axios.get(apiUrl);
      console.log(response)
    }catch(error){
      console.log(error)
    }
      
  },[])

  return (
    <>
    
    <header className="header">
      <div className="logo">
        <h1>YourLogo</h1>
      </div>
      <nav className="nav-menu">
        <ul>
          <li><a href="/">Home</a></li>
          <li><a href="/admin">User Info</a></li>
          <li><a href="/admin">About</a></li>
          {userAdmin ? ( <li><a href="/admin">Admin Panel</a></li>) : null}
        </ul>
      </nav>
      <button className="logout-btn" onClick={logout}>Logout</button>
    </header>
    </>
  );
};

export default Header;
